CREATE TABLE `viaje-Transporte` (
  `idViaje` int NOT NULL AUTO_INCREMENT COMMENT 'Viaje relacionado con la Orden Transporte. Una orden puede tener varios viajes. Documenta fechas de entregas, firmas, etc...',
  `id_OrdenViajeTransporte` int NOT NULL COMMENT 'Viene de la tabla orden-Transporte',
  `numeroOrdenViaje` varchar(225) DEFAULT NULL COMMENT 'Nmero de la orden del viaje',
  `fechaLlegadaViaje` datetime DEFAULT NULL COMMENT 'Fecha de llegada del viaje',
  `fechaSalidaViaje` datetime DEFAULT NULL COMMENT 'Fecha de Salida del Viaje',
  `ObservacionViaje` longtext COMMENT 'Observacion por Viaje',
  `FirmaViajeReceptor` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin COMMENT 'Firma Digital',
  `documentoManual` longtext COMMENT 'Nombre del documento',
  `LUGAR_COD` varchar(255) DEFAULT NULL COMMENT 'CODIGO DE LUGAR',
  `LUGAR_NOMBRE` varchar(255) DEFAULT NULL COMMENT 'NOMBRE DEL LUGAR',
  `LUGAR_DIRECCION` varchar(225) DEFAULT NULL,
  `LUGAR_CP` varchar(225) DEFAULT NULL,
  `LUGAR_POBLACION` varchar(225) DEFAULT NULL,
  `LUGAR_PROVINCIA` varchar(225) DEFAULT NULL,
  `LUGAR_TELEFONO` varchar(225) DEFAULT NULL,
  `ordenViaje` int DEFAULT NULL COMMENT 'Orden en la lista del viaje',
  `tipoViaje` varchar(225) DEFAULT NULL,
  `idViajeUnica` varchar(225) DEFAULT NULL COMMENT 'idViaje unica que debe venir de la orden. ',
  `nombreViajeReceptor` varchar(225) DEFAULT NULL COMMENT 'Nombre del que firma el viaje, documento.',
  `dniViajeReceptor` varchar(225) DEFAULT NULL COMMENT 'DNI del que firma el viaje, documento.',
  `correoViajeReceptor` varchar(225) DEFAULT NULL COMMENT 'Correo al que se le va a enviar el recibo del viaje.',
  `nombreViajeConductor` varchar(225) DEFAULT NULL COMMENT 'Nombre del Trabajador firmante',
  `dniViajeConductor` varchar(225) DEFAULT NULL COMMENT 'DNI del Trabajador firmante',
  `FirmaViajeConductor` longtext COMMENT 'Firma Conductor',
  `firmaOperario` longtext,
  PRIMARY KEY (`idViaje`)
) ENGINE=InnoDB AUTO_INCREMENT=699 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
